// Import React
import React from "react";

// Import Multiselect 
import ReactMultiSelectCheckboxes from 'react-multiselect-checkboxes';


// Import io from socket to send to backend flask
import io from 'socket.io-client';

// Create the socket
const socket = io();

// Component for AngleDial (rendered from Agent)
class LightDrop extends React.Component {

  // Dial has a cur_angle and an id
  constructor(props) {
    super(props);
    this.state = {
      options: [ {"id": 1, "value":"peanuts", "label": 'Option 1'},
                 {"id": 2, "value":"peanuts2", "label": 'Option 2'}]
    };
    this.onSelect = this.onSelect.bind(this);
    this.onRemove = this.onRemove.bind(this);
  }


  onSelect() {
    console.log("Select");
  }

  onRemove() {
    console.log("Remove");
  }

  // Render the Dial component from the react-dial-knob package
  render() {
    const data = this.state.options;
    return ( 
      <ReactMultiSelectCheckboxes 
        options={data}
      />);
    } // End Render
} // End Class





// Let us use in other componenets
export default LightDrop;
